import React from 'react';

import classes from './CarInfo.module.css';
import CarServices from './CarServices';

const CarInfo = (props) => {
  const infoCar = props.allCars.map((cars) => {
    return cars.map((car) => {
      if (car.id !== props.loadCarId) {
        return null;
      }
      return (
        <ul key={car.id}>
          <li>
            brand:<p>{car.brand}</p>
          </li>
          <li>
            series:<p>{car.series}</p>
          </li>
          <li>
            model:<p>{car.model}</p>
          </li>
          <li>
            year:<p>{car.year}</p>
          </li>
          <li>
            engine:<p>{car.engine}</p>
          </li>
          <li>
            mileage:<p>{car.mileage}</p>
          </li>
        </ul>
      );
    });
  });

  const servicesCar = props.allCars.map((cars) => {
    return cars.map((car) => {
      if (car.id !== props.loadCarId) {
        return null;
      }
      return car.services;
    });
  });

  return (
    <div className={classes['car-info']}>
      <div className={classes['car-info-main']}>{infoCar}</div>
      <CarServices allCarServices={servicesCar} />
    </div>
  );
};

export default CarInfo;
